data Posed a = Posed (Int,Int) a
instance (Eq a => Eq (Posed a)) where
    (==) (Posed _ a) (Posed _ b) = a == b
instance (Show a => Show (Posed a)) where
    show (Posed p a) = concat [show p, "~", show a]

pose::(String->a)->AlexPosn->String->Posed a
